  JWILLIAMS, Sarah and HUTTON, Thomas Biddulph
  SHUTTON, Marianne Elizabeth Georgina (Bessie) and KEMP, Francis James
  JKEMP, Edith Sarah and WILSON, James Frederic (Fritz)
