  JNEWLAND, Varien Clare and STEELE, Roderick George
  > NEWLAND, Varien Clarem on 23.02.1963 to STEELE, Roderick George
  b 16.08.1943
  b 19.08.1939
  Varien b. at Wanganui and m. at St Stephen's Church, Waverley. Roderick, s/o Wilfred George Steele
  and Freda Enid Harrison, b. at Stratford. Address: 9 Moir Street (PO Box 114), Eltham.
  Varien was educated at Waverley Primary and St Mary's School, Stratford (1956-60). She nursed in
  New Plymouth until her marriage.
  Rod was educated at Norfolk Road, Inglewood and Stratford High School. He started farming at Rugby
  Road, Eltham with his father. He and Varien later moved to their own dairy farm at Te Roti, Eltham.
  They have lived in Eltham from 1982 where Rod was now a stock clerk at Riverlands. They are now
  retired.
  01> STEELE, Dallis Clarem on 11.02.1989 to BARRETT, Simon Ritchie
  b 18.11.1965
  b 23.07.1963
  Dallis b. at Stratford and m, at Ashleigh Lodge, Eltham. Simon, s/o Graham Prideaux Barrett and
  Ann Sylvia Fewtrell, b. at Dannevirke. Address: Henwood Road, PO Box 3160, New Plymouth.
  Dallis was educated at Eltham Primary School and St Mary's Diocesan School, Stratford (1979-82)
  then completed a Bachelor of Business Studies at Massey University becoming a qualified
  accountant in March 1990.
  Simon was educated at various primary schools in the Taranakil Wairarapa/ Westland areas and
  attended Westland High School, Hokitika (1976-80). He attended Canterbury University and
  completed a Bachelor of Business Studies extramurally. He is now a qualified accountant and
  works for the Lactose Company at Kapuni.
  01> BARRETT, Kailey Jordan
  b 01.04.1996
  Kailey b. at New Plymouth.
  02> STEELE, Grant Roderick m on 13.04.1991 to DEW, Leane Lillian
  b 11.12.1967
  b 22.02.1968
  Grant b. at Stratford and m. at All Saints' Church, Eltham. Leane, d/o Colin George Dew and
  Valerie Maud Sharp, b, at Stratford. Address: 75 Cardiff Road (PO Box 51-084), Pakuranga,
  Auckland.
  Grant was educated at Eltham Primary School and Stratford High School (1981-85) then completed
  a plumbing apprenticeship (1985-89). He started his own plumbing and gasfitting business in
  1990. Leane was educated at Ngaere Primary School, Stratford High School (1981-85) and Central
  Institute of Technology, Wellington (1985-89) and is a pharmacist.
  01> STEELE, Tate James
  b 17.01.1997
  Tate b, at Auckland.
  03> STEELE, Duncan Jarrod
  b 19.10.1970
